import '../App.css';

function OneToOne(props) {
    // tooltip 구현 예정
    return (
        <div className={props.className}>
            <div className="detail-button">
                <i class="fa-solid fa-circle-info"/>
            </div>
            <div className="title">{}</div>
        </div>
    );
}

export default OneToOne;
